uint count_neighbors(const Map& map, int row, int col)
{
    int nrows = map.size();
    int ncols = map[0].size();
    if (row < 0 || row >= nrows || col < 0 || col >= ncols)
        return 0;
    uint ret{0};
    if (row > 0)
    {
        if (col > 0)
            ret += map[row - 1][col - 1];
        ret += map[row - 1][col];
        if (col + 1 < ncols)
            ret += map[row - 1][col + 1];
    }
    if (col > 0)
        ret += map[row][col - 1];
    if (col + 1 < ncols)
        ret += map[row][col + 1];
    if (row + 1 < nrows)
    {
        if (col > 0)
            ret += map[row + 1][col - 1];
        ret += map[row + 1][col];
        if (col + 1 < ncols)
            ret += map[row + 1][col + 1];
    }
    return ret;
}

uint part1(const Map& map)
{
    uint ret{0};
    int nrows = map.size();
    int ncols = map[0].size();
    for (int row=0; row < nrows; ++row)
    {
        for (int col=0; col < ncols; ++col)
        {
            if (map[row][col] == 0) continue;
            if (count_neighbors(map, row, col) < 4)
            {
                ++ret;
            }
        }
    }
    return ret;
}

uint part2(Map& map)
{
    uint ret{0};
    int nrows = map.size();
    int ncols = map[0].size();
    for (;;)
    {
        uint prev_ret = ret;
        for (int row=0; row < nrows; ++row)
        {
            for (int col=0; col < ncols; ++col)
            {
                if (map[row][col] == 0) continue;
                if (count_neighbors(map, row, col) < 4)
                {
                    map[row][col] = 0;
                    ++ret;
                }
            }
        }
        if (prev_ret == ret) break;
    }
    return ret;
}

